/*
Interfacing Bluetooth with the Seeed Studio XIAO nRF52840 involves using the ArduinoBLE library. Below is a simple example showing how to create a BLE server that advertises a custom service and characteristic.

First, ensure that the ArduinoBLE library is installed in your Arduino IDE.

This example creates a Bluetooth device named "XIAO nRF52840" that has a custom service (with UUID 180D) and a custom characteristic (with UUID 2A37). The characteristic is readable and can notify a connected device when its value changes. When a central device (like your smartphone) connects to the XIAO, it increments the value of the characteristic every second until the central device disconnects.

Note: The example uses placeholder UUIDs (180D for the service and 2A37 for the characteristic) which you may want to replace with your own UUIDs. The UUIDs should adhere to the standard Bluetooth UUID format.

Please replace the UUIDs and the characteristic properties according to your needs.
*/

#include <ArduinoBLE.h>

BLEService customService("180D"); // create a service with a custom UUID
BLEIntCharacteristic customCharacteristic("2A37", BLERead | BLENotify); // create a characteristic with a custom UUID

void setup() {
  Serial.begin(9600);
  
  // while not connected to the serial port, do nothing
  while (!Serial);

  if (!BLE.begin()) {
    Serial.println("starting BLE failed!");
    while (1);
  }

  BLE.setLocalName("XIAO nRF52840"); // set the name of the device
  BLE.setAdvertisedService(customService); // advertise the custom service
  customService.addCharacteristic(customCharacteristic); // add the custom characteristic to the service
  BLE.addService(customService); // add the service
  
  customCharacteristic.writeValue(0); // set the initial value of the characteristic

  BLE.advertise(); // start advertising

  Serial.println("BLE device active, waiting for connections...");
}

void loop() {
  // wait for a BLE central device to connect
  BLEDevice central = BLE.central();

  if (central) {
    Serial.print("Connected to central: ");
    Serial.println(central.address());
    
    while (central.connected()) {
      // this is where you would write the sensor readings to the characteristic
      // for the sake of example, let's just increment the characteristic value every second
      int currentValue = customCharacteristic.value();
      customCharacteristic.writeValue(currentValue + 1);
      delay(1000);
    }

    Serial.print("Disconnected from central: ");
    Serial.println(central.address());
  }
}

#include <bits/stdc++.h>

#define prm(x) x.begin(), x.end()
#define srt(x) sort(prm(x))
#define rvs(x) reverse(prm(x))

using namespace std;
using ll = long long;
using ld = long double;

vector<ll> p1{1, -1, 0, 0}, p2{0, 0, 1, -1};
bool chk(vector<vector<ll>> &v)
{
    ll a = v.at(0).at(0);
    for (auto &c1 : v)
    {
        for (auto &c2 : c1)
        {
            if (c2 != a)
            {
                return true;
            }
        }
    }
    return false;
}

void rep(vector<vector<ll>> &v, ll ch)
{
    ll num = v.at(0).at(0);
    vector<vector<bool>> ex(v.size(), vector<bool>(v.size(), false));
    deque<pair<ll, ll>> bfs{{0, 0}};
    //***************************************************************** BFS ↓
    while (!bfs.empty())
    {
        ex.at(bfs.at(0).first).at(bfs.at(0).second) = true;
        v.at(bfs.at(0).first).at(bfs.at(0).second) = ch;
        for (int i = 0; i < 4; i++)
        {
            ll x = bfs.at(0).first + p1.at(i);
            ll y = bfs.at(0).second + p2.at(i);
            if (x > -1 && x < v.size() && y > -1 && y < v.size())
            {
                if (!ex.at(x).at(y))
                {
                    if (v.at(x).at(y) == num)
                    {

                        bfs.push_back({x, y});
                    }
                }
            }
        }
        bfs.pop_front();
    }
    //***************************************************************** BFS ↑
}

pair<ll, ll> vrf(vector<vector<ll>> &v)
{
    ll mx = 0, tc = 0;
    ll num = v.at(0).at(0);

    vector<vector<bool>> ex(v.size(), vector<bool>(v.size(), false));
    vector<ll> cal(7);
    deque<pair<ll, ll>> bfs{{0, 0}};

    ex.at(0).at(0) = true;
    //***************************************************************** BFS ↓
    while (!bfs.empty())
    {

        for (int i = 0; i < 4; i++)
        {
            ll c1 = bfs.at(0).first;
            ll c2 = bfs.at(0).second;
            ll x = bfs.at(0).first + p1.at(i);
            ll y = bfs.at(0).second + p2.at(i);
            if (x > -1 && x < v.size() && y > -1 && y < v.size())
            {
                if (ex.at(x).at(y) == false)
                {
                    if (v.at(c1).at(c2) == num)
                    {
                        if (v.at(x).at(y) != num)
                        {
                            cal.at(v.at(x).at(y)) += 1;
                        }
                        ex.at(x).at(y) = true;
                        bfs.push_back({x, y});
                    }
                    else
                    {
                        if (v.at(c1).at(c2) == v.at(x).at(y))
                        {
                            cal.at(v.at(x).at(y)) += 1;
                            ex.at(x).at(y) = true;
                            bfs.push_back({x, y});
                        }
                    }
                }
            }
        }
        bfs.pop_front();
    }
    //***************************************************************** BFS ↑

    for (int i = 1; i < 7; i++)
    {
        if (cal.at(i) > mx)
        {
            mx = cal.at(i);
            tc = i;
        }
    }
    return {mx, tc};
}

int main()
{
    ll t;
    cin >> t;
    while (t-- > 0)
    {
        ll n;
        cin >> n;
        vector<vector<ll>> v(n, vector<ll>(n));
        //---------------------------------- Read
        for (auto &c1 : v)
        {
            for (auto &c2 : c1)
            {
                char x;
                cin >> x;
                c2 = x - '0';
            }
        }
        //---------------------------------- Read

        //>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>> Solving
        vector<ll> op(7);
        if (chk(v))
        {
            while (true)
            {
                ll mx = 0, ch = 0;
                pair<ll, ll> ax;
                ax = vrf(v);
                mx = ax.first;
                ch = ax.second;
                if (ch == 0)
                {
                    break;
                }
                op.at(ch) += 1;
                rep(v, ch);
            }
        }
        //>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>> Solving

        //!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!! Output
        ll sum = 0;
        for (auto cl : op)
        {
            sum += cl;
        }
        cout << sum << endl;
        for (int i = 1; i < 7; i++)
        {
            cout << op.at(i) << " ";
        }
        cout << endl;
        //!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!! Output
    }
    return 0;
}

/*
Here are the main components that you will need:

An ESP32 module
A DC water pump (3-6V)
A moisture sensor (e.g., capacitive soil moisture sensor v1.2)
A transistor and a diode (to control the pump)
A resistor (to limit the current flowing into the transistor's base)

Just replace "Your-SSID" and "Your-WiFi-Password" with your actual WiFi SSID and password.

The code checks the soil moisture level every second and if it's below a certain threshold (in this case, 500, which you may need to adjust based on your soil moisture sensor and plant needs), it turns the pump on, but only if it's not already running. Once the pump is on, it will run for 30 seconds (PUMP_TIME) and then turn off automatically.

The web server has three endpoints:

http://your-esp32-ip/status which returns the current moisture level.
http://your-esp32-ip/on which turns the pump on if it's not already running.
http://your-esp32-ip/off which turns the pump off if it's currently running.
Each "/on" and "/off" request checks the current pump state to prevent unnecessary operation.
*/

#include <WiFi.h>
#include <ESPAsyncWebServer.h>

#define WIFI_SSID "Your-SSID"
#define WIFI_PASSWORD "Your-WiFi-Password"

#define PUMP_PIN 2
#define MOISTURE_SENSOR_PIN 35

#define PUMP_TIME 30000 // pump will work for 30 seconds 

AsyncWebServer server(80);

bool pumpRunning = false;
unsigned long pumpStartMillis;

void setup() {
  Serial.begin(115200);

  pinMode(PUMP_PIN, OUTPUT);
  pinMode(MOISTURE_SENSOR_PIN, INPUT);

  connectToWifi();
  setupServer();
}

void loop() {
  int sensorValue = analogRead(MOISTURE_SENSOR_PIN);
  
  if (pumpRunning && (millis() - pumpStartMillis >= PUMP_TIME)) {
    digitalWrite(PUMP_PIN, LOW);
    pumpRunning = false;
  } else if (sensorValue < 500 && !pumpRunning) { // change the threshold as needed
    digitalWrite(PUMP_PIN, HIGH);
    pumpRunning = true;
    pumpStartMillis = millis();
  }

  delay(1000); // check every 1 second
}

void connectToWifi() {
  Serial.print("Connecting to ");
  Serial.println(WIFI_SSID);

  WiFi.begin(WIFI_SSID, WIFI_PASSWORD);

  while (WiFi.status() != WL_CONNECTED) {
    delay(500);
    Serial.print(".");
  }

  Serial.println("");
  Serial.println("WiFi connected.");
  Serial.println("IP address: ");
  Serial.println(WiFi.localIP());
}

void setupServer() {
  server.on("/status", HTTP_GET, [](AsyncWebServerRequest *request) {
    int sensorValue = analogRead(MOISTURE_SENSOR_PIN);
    String sensorStr = String(sensorValue);
    request->send(200, "text/plain", sensorStr);
  });

  server.on("/on", HTTP_GET, [](AsyncWebServerRequest *request) {
    if (!pumpRunning) {
      digitalWrite(PUMP_PIN, HIGH);
      pumpRunning = true;
      pumpStartMillis = millis();
      request->send(200, "text/plain", "Pump is On");
    } else {
      request->send(200, "text/plain", "Pump is already On");
    }
  });

  server.on("/off", HTTP_GET, [](AsyncWebServerRequest *request) {
    if (pumpRunning) {
      digitalWrite(PUMP_PIN, LOW);
      pumpRunning = false;
      request->send(200, "text/plain", "Pump is Off");
    } else {
      request->send(200, "text/plain", "Pump is already Off");
    }
  });

  server.begin();
}

#include <iostream>
#include <vector>

bool next_combination(std::vector<int>& a, int n) {
	int k = (int)a.size();
	for (int i = k - 1; i >= 0; --i) {
		if (a[i] < n - k + i + 1) {
			++a[i];
			for (int j = i + 1; j < k; ++j)
				a[j] = a[j - 1] + 1;
			return true;
		}
	}
	return false;
}

int main() {
	std::vector<int> vec = { 3,4,8 };
	for (int i = 0; i < 3; ++i) {
		next_combination(vec, 9);
		for (auto i : vec)
			std::cout << i << " ";
		std::cout << std::endl;
	}
}

