import java.io.BufferedReader;
import java.io.IOException;
import java.io.InputStreamReader;
import java.util.*;
import java.util.stream.Collectors;

public class InventoryManager {
    public static void main(String[] args) throws IOException {
        InputStreamReader reader = new InputStreamReader(System.in);
        BufferedReader bufferedReader = new BufferedReader(reader);

        String input = bufferedReader.readLine();
        Set<ProductImpl> products = new HashSet<>();
        Map<String, List<ProductImpl>> categories = new HashMap<>();
        
        while (!input.equals("end")) {
            String[] tokens = input.split("\\s+");
            String command = tokens[0];
            String message = "";

            switch (command) {
                case "add":
                    ProductImpl product = new ProductImpl(tokens[1], Double.parseDouble(tokens[2]));
                    categories.putIfAbsent(tokens[3], new ArrayList<>());
                    categories.get(tokens[3]).add(product);

                    if (products.contains(product)) {
                        message = String.format("Error: Item %s already exists%n", product.getName());
                    } else {
                        products.add(product);
                       message = String.format("Ok: Item %s added successfully%n", product.getName());
                    }

                    break;
                case "filter":
                    Set<ProductImpl> sorted;

                    if (tokens[2].equals("type")) {
                        String type = tokens[3];

                        if (!categories.containsKey(type)) {
                            message = String.format("Error: Type %s does not exist%n", type);
                        } else {
                            sorted = new HashSet<>(categories.get(type));
                            sortAndPrintList(sorted, Math.min(sorted.size(), 10));
                        }
                    } else {
                        String direction = tokens[3];

                        if (direction.equals("from")) {
                            double minPrice = Double.parseDouble(tokens[4]);
                            if (tokens.length == 7) {
                                double maxPrice = Double.parseDouble(tokens[6]);
                                sorted = products
                                        .stream()
                                        .filter(product1 ->
                                                product1.getPrice() >= minPrice && product1.getPrice() <= maxPrice)
                                        .collect(Collectors.toCollection(LinkedHashSet::new));
                            } else {
                                sorted = products
                                        .stream()
                                        .filter(product1 -> product1.getPrice() >= minPrice)
                                        .collect(Collectors.toCollection(LinkedHashSet::new));
                            }
                        } else {
                            double maxPrice = Double.parseDouble(tokens[4]);
                            sorted = products
                                    .stream()
                                    .filter(product1 -> product1.getPrice() <= maxPrice)
                                    .collect(Collectors.toCollection(LinkedHashSet::new));
                        }

                        sortAndPrintList(sorted, Math.min(sorted.size(), 10));
                    }
                    break;
            }
            System.out.print(message);
            input = bufferedReader.readLine();
        }

    }

    private static void sortAndPrintList(Set<ProductImpl> sorted, int size) {
        sorted = sorted.stream()
                .sorted(Comparator.comparing(ProductImpl::getName))
                .sorted(Comparator.comparing(ProductImpl::getPrice))
                .collect(Collectors.toCollection(LinkedHashSet::new));

        System.out.print("Ok: ");
        for (ProductImpl product : sorted) {
            if (size > 1) {
                System.out.printf("%s(%.2f), ", product.name, product.price);
            } else if (size == 1) {
                System.out.printf("%s(%.2f)", product.name, product.price);
            } else {
                break;
            }
            size--;
        }
        System.out.println();
    }

    private static class ProductImpl {
        private final String name;
        private final double price;

        public ProductImpl(String name, double price) {
            this.name = name;
            this.price = price;
        }

        public String getName() {
            return name;
        }

        public double getPrice() {
            return price;
        }

        @Override
        public boolean equals(Object obj) {
            if (this == obj) return true;
            if (obj == null) return false;
            ProductImpl product = (ProductImpl) obj;
            return name.equals(product.name);
        }

        @Override
        public int hashCode() {
            return Objects.hash(name);
        }

    }

}

