	width: 100%;
}

/* HEADERS */

.header {
	position: fixed;
	top: 0;
	right: 0;
	
	width: calc(40px + 2vh);
	height: calc(40px + 2vh);
	
	transform: rotate(90deg) translateY(calc(-40px + -2vh));
	transform-origin: left top;
	z-index: 110;
}
.header .header-title {
	top: 0;
	left: 0;
	
	width: calc(40px + 2vh);
	height: calc(40px + 2vh);
	background: none;
	
	font-size: 0;
	text-indent: initial;
	
	transition: all 0.3s ease;
}
.header .header-title:hover {
	background: #080808;
}
.header .header-title:before {
	content: "\f015";
	
	display: block;
	width: calc(40px + 2vh);
	height: calc(40px + 2vh);
	
	color: #fff;
	font: calc(25px + 1vh)/calc(40px + 2vh) FontAwesome;
	
	transition: all 0.3s ease;
}
.header .header-title:hover:before {
	height: calc(30px + 1vh);
	line-height: calc(30px + 1vh);
}
.header .header-title:after {
	content: "Home";
	
	display: block;
	width: calc(40px + 2vh);
	height: calc(10px + 1vh);
	
	color: rgba(255,255,255,0);
	font-size: calc(5px + 1vh);
	white-space: nowrap;
	
