	color: #fff;
	font: 18px/18px Oxygen, sans-serif !important;
	text-transform: uppercase;
	text-shadow:
		0px 0px 2px #000,
		0px 0px 1px #000;
	letter-spacing: calc(0.5vh - 1px);
	white-space: nowrap;
	text-overflow: ellipsis;
	
	transition: all 0.1s ease;
}
