#include <iostream>
#include <string>
using namespace std;

class ArrSel {
	int *Arr;
	int nElem;
	string *Name;
	string *Marka;
	int *Ball;
	int* a;

	public: ArrSel(int max) {
		Arr = new int[max];
		Name = new string[max];
		Marka = new string[max];
		Ball = new int[max];
		nElem = 0;
	}

	public: void insert(int value, int ball, string name, string surname) {
		Arr[nElem] = value;
		Ball[nElem] = ball;
		Name[nElem] = name;
		Marka[nElem] = surname;
		nElem++;
	}

	public: void display() {
		for (int j(0); j < nElem; j++) {
			cout << Arr[j] << " sredBall: " << Ball[j] << " Name: " << Name[j] << " Surname: " << Marka[j] << " \n";
		}
		cout << "\n";
	}

	public: void selectionSort() {
		int out, in, max;
		for (out = 0; out < nElem; out++) {
			max = out;
			for (int in = out + 1; in < nElem; in++) {
				if (Arr[in] > Arr[max]) {
					max = in;
					swap(out, max);
				}
			}
		}
	}
	public: void swap(int one, int two) {
		int temp = Arr[one];
		Arr[one] = Arr[two];
		Arr[two] = temp;
		int temp1 = Ball[one];
		Ball[one] = Ball[two];
		Ball[two] = temp1;
		string temp2 = Name[one];
		Name[one] = Name[two];
		Name[two] = temp2;
		string temp3 = Marka[one];
		Marka[one] = Marka[two];
		Marka[two] = temp3;
	}

	public: int insertionSort() {
		int in, out;
		int elem = coppy();
		for (out = 1; out < elem; out++) {
			int temp = a[out];
			in = out;
			while (in > 0 && a[in - 1] <= temp) {
				a[in] = a[in - 1];
				--in;
			}
			a[in] = temp;

		}
		return elem;
	}

	public: void display_a(int elem) {
		for (int i(0); i < elem; i++) {
			cout << a[i] << " ";
		}
		cout << " ";
	}

	public: int coppy() {
		a = new int[nElem];
		int j(0);
		for (int i(0); i < nElem; i++) {
			if (Marka[i] == "Жигули") {
				a[j] = Ball[i];
				j++;
			}
		}
		return j;
	}
};

void main() {
	setlocale(LC_ALL, "Russian");
	int maxSize = 10;
	ArrSel arr(maxSize);
	arr.insert(88, 15, "CерГей", "Жигули");
	arr.insert(45, 4, "АссАлан", "Мерседес");
	arr.insert(85, 412, "Асfdvdsvлан", "Копейка");
	arr.insert(35, 42, "Асzvw", "Лада");
	arr.insert(15, 44, "vfeан", "Жигули");
	arr.insert(46, 73, "Аvferevлан", "Газель");
	arr.insert(91, 140, "Cтарый", "Жигули");
	arr.insert(24, 3, "sdvefbлан", "Буханка");
	cout << "Оригинал: \n";
	arr.display();
	arr.selectionSort();
	cout << "Отсортированно методом выбора: \n";
	arr.display();
	cout << "Отсортированно методом вставки: \n";
	arr.display_a(arr.insertionSort());
}

#include <iostream>
using namespace std;

struct Node
{
    int x;
    Node* left, * right;
};

void push(int x, Node*& Tree) { //& т.к. нужно работать с данным деревом, а не его копией
	if (Tree == NULL) {
		Tree = new Node;
		Tree->x = x;
		Tree->left = Tree->right = NULL;
	}
	else
		if ((Tree->x) > x) {
			if ((Tree->left) != NULL) push(x, Tree->left);
			else {
				Tree->left = new Node;
				Tree->left->x = x;
				Tree->left->left = Tree->left->right = NULL;
			}
		}
		else
			if ((Tree->x) < x) {
				if ((Tree->right) != NULL) push(x, Tree->right);
				else {
					Tree->right = new Node;
					Tree->right->x = x;
					Tree->right->left = Tree->right->right = NULL;
				}
			}
}

void write(Node* Head, int space, string a)
{
	if (Head != NULL) {
		write(Head->right, space + 1, "r");
		for (int i = 0; i < space; i++) {
			cout << " ";
		}
		cout << a << " " << Head->x << endl;
		write(Head->left, space + 1, "l");
	}
}

void auto_tree(Node*& Tree, int n, int min, int max) {
	for (int i(0); i <= n; i++) {
		int random = min + rand() % (max - min + 1);
		push(random, Tree);
	}
}

Node* _poisk_(Node* Tree, int key) {
	Node* pred = Tree;
	while (Tree->x != key) {
		if (Tree->x > key) {
			if (Tree->left != NULL) {
				Tree = Tree->left;
			}
			else { break; }
		}
		else if (Tree->x < key) {
			if (Tree->right != NULL) {
				Tree = Tree->right;
			}
			else { break; }
		}
	}
	if (Tree->x != key) {
		return NULL;
	}
	return Tree;
}

void vikl(Node* Tree, int key) {
	Node* tree = Tree;
	Node* pred = tree;
	while (tree->x != key) {
		pred = tree;
		if (tree->x > key) {
			if (tree->left != NULL) {
				tree = tree->left;
			}
			else { break; }
		}
		else if (tree->x < key) {
			if (tree->right != NULL) {
				tree = tree->right;
			}
			else { break; }
		}
	}

	if ((tree->left == NULL) && (tree->right == NULL)) {
		if (pred->left == tree) {
			pred->left = NULL;
		}
		else {
			pred->right = NULL;
		}
	}
	else if ((tree->left == NULL) || (tree->right == NULL)) {
		Node* preem = tree;
		Node* predpreem = preem;
		if (preem->left != NULL) {
			preem = preem->left;
			while (preem->right != NULL) {
				predpreem = preem;
				preem = preem->right;
			}
			if (pred->left == tree) {
				pred->left->x = preem->x;
				if (predpreem->left == preem) predpreem->left = NULL;
				if (predpreem->right == preem) predpreem->right = NULL;
				preem = NULL;
			}
			else {
				pred->right->x = preem->x;
				if (predpreem->left == preem) predpreem->left = NULL;
				if (predpreem->right == preem) predpreem->right = NULL;
				preem = NULL;

			}
		}
		else {
			preem = preem->right;
			while (preem->left != NULL) {
				predpreem = preem;
				preem = preem->left;
			}
			if (pred->left == tree) {
				pred->left->x = preem->x;
				if (predpreem->left == preem) predpreem->left = NULL;
				if (predpreem->right == preem) predpreem->right = NULL;
				preem = NULL;

			}
			else {
				pred->right->x = preem->x;
				if (predpreem->left == preem) predpreem->left = NULL;
				if (predpreem->right == preem) predpreem->right = NULL;
				preem = NULL;

			}
		}
	}
	/*else if ((tree->left != NULL) && (tree->right != NULL)) {

	}*/
}

void opred_vkl_or_vikl(int key, Node* Tree) {
	Node *tree = _poisk_(Tree, key);
	if (tree == NULL) {
		push(key, Tree);
	}
	else {
		vikl(Tree, key);
	}
}

int main()
{
    Node* tree = NULL;
	auto_tree(tree, 15, -99, 99);
	cout << "original Tree\n";
	write(tree, 0, "S");

	cout << "\nVkluchenie (3)\n";
	opred_vkl_or_vikl(3, tree);
	write(tree, 0, "S");
	cout << "----------------- (42)" << endl;
	opred_vkl_or_vikl(42, tree);
	write(tree, 0, "S");
